import React from 'react';
import './App.css';


const App = () => {
  return (
    <div className="app-wrap">
      <header className="header">
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR7WLLQxT7M-194dgg1Wid3Fw_LCV1SfHv1ug&usqp=CAU"></img>

      </header>
      <nav className="nav">
        <ul>
          <li><a>Profile</a></li>
          <li><a>Messages</a></li>
          <li><a>News</a></li>
          <li><a>Messages</a></li>
        </ul>
      </nav>
      <div className="content">

      </div>

    </div>
  );
}

export default App;
